import{_ as o,o as t,c as a,z as e,a as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 19.2-98 Same; for prisoners being taken through Commonwealth.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-98.md","filePath":"vacode/19.2-98.md"}'),n={name:"vacode/19.2-98.md"},i=e("h1",{id:"§-19-2-98-same-for-prisoners-being-taken-through-commonwealth",tabindex:"-1"},[r("§ 19.2-98 Same; for prisoners being taken through Commonwealth. "),e("a",{class:"header-anchor",href:"#§-19-2-98-same-for-prisoners-being-taken-through-commonwealth","aria-label":'Permalink to "§ 19.2-98 Same; for prisoners being taken through Commonwealth."'},"​")],-1),h=e("p",null,"The officer or agent of a demanding state to whom a prisoner may have been delivered following extradition proceedings in another state or to whom a prisoner may have been delivered after waiving extradition in such other state, and who is passing through this Commonwealth with such prisoner for the purpose of returning immediately such prisoner to the demanding state may, when necessary, confine the prisoner in the jail of any county or city through which he may pass; and the keeper of such jail shall receive and safely keep the prisoner until the officer or agent having charge of him is ready to proceed on his route, such officer or agent, however, being chargeable with the expense of keeping, provided, however, that such officer or agent shall deliver to the jailer the warrant or legal order authorizing custody of the prisoner. Such prisoner shall not be entitled to demand a new requisition while in this Commonwealth.",-1),s=e("p",null,"Code 1950, § 19.1-62; 1960, c. 366; 1975, c. 495.",-1),c=[i,h,s];function d(l,m,p,f,g,u){return t(),a("div",null,c)}const v=o(n,[["render",d]]);export{_ as __pageData,v as default};
